import React from "react";

import Menu from "./Menu";
import "./HeaderMobile.css";

const HeaderMobile = props => {
	let mobileMenu;

	if (props.isMobileMenuOpen) {
		mobileMenu = <Menu />;
	}
	return (
		<header className="mobile flex f-col jc-start">
			<button className="hamburger" onClick={props.click}>
				<span className="line line-01" />
				<span className="line line-02" />
				<span className="line line-03" />
				<span className="line line-04" />
			</button>
			{mobileMenu}
		</header>
	);
};

export default HeaderMobile;
